def saveIpsMachine(nameFile, ipsList):
    machineCountries = set()
    arquivo = open(nameFile, 'w')
    for ip in ipsList:
        print(ip)
        try:
            with urllib.request.urlopen("https://geolocation-db.com/jsonp/{0}".format(ip)) as url:
                data = url.read().decode()
                data = data.split("({")[1].strip("})")
                data = data.split(",")
                machineCountries.add((data[1].replace('"', '').split(":")[1]))
                arquivo.write(data[1].replace('"', '').split(":")[1] + ',\n')
        except:
            print('Deu ruim')

    return machineCountries



